import React, { Component } from "react";

class Login extends Component {
    render() {
        return (
            <div>
                <center>
                    <h1>Faça login para continuar</h1> <br />
                    <form>
                        <h3>Email:</h3> <br />
                        <input type={'email'} /> <br />
                        <h3>Senha:</h3>
                        <input type={'password'} maxLength='11' /> <br /> <br />
                        <button>Entrar</button>
                    </form>

                </center>

            </div>
        )
    }
}

export default Login
